function charge_fraction($i,$s,$meanQ)
{
  $j=0; $F=0.0;
  while($F<0.001)
    {
      $F=exp((-1.0*(pow($j-$meanQ,2)))/(2.0*$s*$s));
      $j=$j+1;
    }
  $sum=0.0;
  while($F>=0.001)
    {
      $F=exp((-1.0*(pow($j-$meanQ,2)))/(2.0*$s*$s));
      $sum=$sum+$F;
      $j=$j+1;
    }
  // Sum of charge state fractions must equal 1.0 so normalize the height of the mean charge state fraction appropriately.
  $F=exp((-1.0*(pow($meanQ-$meanQ,2)))/(2.0*$s*$s));
   $height=$F/$sum;
   // echo "<BR>"+$height+", "+$F+", "+$sum+"<BR>";

  $F=$height*exp((-1.0*(pow($i-$meanQ,2)))/(2.0*$s*$s));
  $F=$F*100;
  return($F);
}

    function imagethickline($image, $x1, $y1, $x2, $y2, $color, $thick = 1)
{
    /* this way it works well only for orthogonal lines
    imagesetthickness($image, $thick);
    return imageline($image, $x1, $y1, $x2, $y2, $color);
    */
    if ($thick == 1) {
        return imageline($image, $x1, $y1, $x2, $y2, $color);
    }
    $t = $thick / 2 - 0.5;
    if ($x1 == $x2 || $y1 == $y2) {
        return imagefilledrectangle($image, round(min($x1, $x2) - $t), round(min($y1, $y2) - $t), round(max($x1, $x2) + $t), round(max($y1, $y2) + $t), $color);
    }
    $k = ($y2 - $y1) / ($x2 - $x1); //y = kx + q
    $a = $t / sqrt(1 + pow($k, 2));
    $points = array(
        round($x1 - (1+$k)*$a), round($y1 + (1-$k)*$a),
        round($x1 - (1-$k)*$a), round($y1 - (1+$k)*$a),
        round($x2 + (1+$k)*$a), round($y2 - (1-$k)*$a),
        round($x2 + (1-$k)*$a), round($y2 + (1+$k)*$a),
    );
    imagefilledpolygon($image, $points, 4, $color);
    return imagepolygon($image, $points, 4, $color);
}

